import React from 'react';
import './App.css';
import Products from './components/Products';
import Payments from './components/Payments';

function App() {
  return (
      <div className="App">
        <header className="App-header">
          <h1>Sklep Online</h1>
        </header>
        <Products />
        <Payments />
      </div>
  );
}

export default App;
